function render(id) { 
  var dom = null;

  id = id || 'designer-workspace';

  if (id === 'body') {
    dom = document.body;
  } else {
    dom = document.getElementById(id);
  }

  dom.insertAdjacentHTML('beforeend', this.getHTML());
}

