function getHTML() { 
  var html = this.source();
  var pattern = '';
  var matches = null;
  var message = '';
  var key = '';

  // localization
  pattern = /<i18n[^\/]*\/i18n>/;
  matches = html.match(pattern);

  if (matches) {

    key = matches[0].split('{')[1].split('}')[0].trim();
    message = this.require('i18n').get(key);

    html = html.replace(matches[0], message);
  }

  return html;
}
